import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from '../users.service';

@Component({
  selector: 'app-register-component',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})

export class RegisterComponent implements OnInit{
  ngOnInit(): void {
    console.log("register");
  }

  onSubmit() {

  }
}
<form [formGroup]="register" (ngSubmit)="onSubmit()">
  <div class="form-group">
    <label for="firstName">First Name <i class="bi bi-cash-coin"></i></label>
    <input id="firstName" class="form-control" formControlName="firstName" />
  </div>
  <div class="form-group">
    <label for="lastName">Last Name <i class="bi bi-cash-coin"></i></label>
    <input id="lastName" class="form-control" formControlName="lastName" />
  </div>
  <div class="form-group">
    <label for="address">Address <i class="bi bi-cash-coin"></i></label>
    <input id="address" class="form-control" formControlName="address" />
  </div>
  <div class="form-group">
    <label for="number">Number <i class="bi bi-cash-coin"></i></label>
    <input id="number" class="form-control" formControlName="number" />
  </div>
  <div class="form-group">
    <label for="email">Email <i class="bi bi-cash-coin"></i></label>
    <input id="email" class="form-control" formControlName="email" />
  </div>
  <div class="form-group">
    <label for="password">Password <i class="bi bi-cash-coin"></i></label>
    <input id="password" class="form-control" formControlName="password" />
  </div>
  <button type="submit">Register</button>
</form>
